// ==UserScript==
// @name         IITC skin
// @namespace    https://github.com/jonatkins/ingress-intel-total-conversion
// @version      0.1
// @description  Nicer skin for IITC desktop
// @author       Philip Graham <https://github.com/pgraham>
// @match        https://*.ingress.com/intel*
// @grant        none
// ==/UserScript==

if (window.plugin === undefined) {
	window.plugin = function () {};
}
window.plugin.minSkin = { hooks: [] };

/**
 * 
 */
"use strict";

window.plugin.minSkin.hooks.push({
	event: "portalDetailsUpdated",
	handler: function () {
		var el = $("#portaldetails");

		// Get rid of some of the overwhelming amount of brightness
		if (el.is(".enl")) {
			el.removeClass("enl");
			el.find("#level").addClass("enl");
		} else if (el.is(".res")) {
			el.removeClass("res");
			el.find("#level").addClass("res");
		}

		el.find(".mods").children().each(function () {
			$(this).addClass($(this).text().toLowerCase().replace(/\s+/g, "-"));
			$(this).empty();
			$(this).addClass("mod").wrap($("<div/>").addClass("container"));
		});
	}
});


(function() {
	'use strict';

	function addStyle(contentProvider) {
		let style = document.createElement("style");
		style.type = "text/css";
		style.appendChild(document.createTextNode(contentProvider()));
		document.head.appendChild(style);
	}

	function installHooks() {
		let hooks = window.plugin.minSkin.hooks;

		hooks.forEach(function (hook) {
			window.addHook(hook.event, hook.handler);
		});
	}

	function init() {
		addStyle(getIITCSkinCss);
		addStyle(getEmbeddedImageStyles);
		installHooks();
	}

	init.info = { pluginId: "My Skin", dateTimeVersion: "0.1" };
	if(!window.bootPlugins) window.bootPlugins = [];
	window.bootPlugins.push(init);
})();

function getIITCSkinCss() {
	return `
#sidebar {
  background-color: rgba(8, 48, 78, 0.7);
}
#portaldetails {
  display: flex;
  flex-direction: column;
  color: #FFF;
}
#portaldetails .title {
  height: 4em;
  padding: 0 0 0 4.2em;
  width: auto;
}
#portaldetails .close {
  top: 0;
  right: 0;
  padding: 0.2em;
}
#portaldetails .imgpreview {
  position: absolute;
  top: 0;
  left: 0;
  width: 4em;
  height: 4em;
  background-size: cover;
  background-position: left;
}
#portaldetails .mods {
  display: flex;
  justify-content: space-between;
}
#portaldetails .mods .container {
  width: 2.5em;
  height: 2.5em;
  padding: 0.5em;
}
#portaldetails .mods .mod {
  background-size: contain;
  background-position: center;
  width: 100%;
  height: 100%;
}
#level {
  font-size: 1.5em;
  padding: 0 0.2em;
  margin: 0;
  text-align: left;
  float: none;
}

`;
}

